import React, { Component } from "react";
import {
	BrowserRouter as Router,
	Routes,
	Route,
	Link,
} from "react-router-dom";
import Chat from "./Chat";
import Home from './Home';



class App extends Navbar {
	render() {
		return (
			<Router>
				<div className="App">
					<ul className="App-header">
						<li>
							<Link to="/">Home</Link>
						</li>
						<li>
							<Link to="/Chat">
								Chat
							</Link>
						</li>
						<li>
							<Link to="/Music">
								Music
							</Link>
						</li>
					</ul>
					<Routes>
						<Route
							exact
							path="/"
							element={<Home />}
						></Route>
						<Route
							exact
							path="/Chat"
							element={<Chat />}
						></Route>
						<Route
							exact
							path="/Music"
							element={<Music />}
						></Route>
					</Routes>
				</div>
			</Router>
		);
	}
}

export default Navbar;
